import styled from 'styled-components';

export const StyledPosition = styled.div`
  background-color: #ddd4d4;
  width: 100px;
  height: 100px;
  padding: 15px;
  font-size: 10px;
  display: flex;
  flex-wrap: wrap;
  flex-direction: column;
`;
export const StyledGuitarTabsList = styled.div``;
